use core::ops::BitXor;

#[inline]
pub const fn from_canonical(a: u128) -> u128 {
    montgomery_multiply(a, 0x1e563df92ea7081b4563df92ea7081b5)
}

#[inline]
pub const fn to_canonical(a: u128) -> u128 {
    montgomery_multiply(a, 1)
}

/// The POLYVAL "dot" operation defined in [`RFC 8542`][1], Section 3.
///
/// This is the operation $a b x^{-128}$ in the field
/// $F_2\[X\] / (X^128 + X^127 + X^126 + X^121 + 1)$, which is a Montgomery multiplication of
/// polynomials with an R value of $X^128$.
///
/// [1]: <https://datatracker.ietf.org/doc/html/rfc8452>
pub const fn montgomery_multiply(a: u128, b: u128) -> u128 {
    let h0 = a as u64;
    let h1 = (a >> 64) as u64;
    let h0r = rev64(h0);
    let h1r = rev64(h1);
    let h2 = h0 ^ h1;
    let h2r = h0r ^ h1r;

    let y0 = b as u64;
    let y1 = (b >> 64) as u64;
    let y0r = rev64(y0);
    let y1r = rev64(y1);
    let y2 = y0 ^ y1;
    let y2r = y0r ^ y1r;
    let z0 = bmul64(y0, h0);
    let z1 = bmul64(y1, h1);

    let mut z2 = bmul64(y2, h2);
    let mut z0h = bmul64(y0r, h0r);
    let mut z1h = bmul64(y1r, h1r);
    let mut z2h = bmul64(y2r, h2r);

    z2 ^= z0 ^ z1;
    z2h ^= z0h ^ z1h;
    z0h = rev64(z0h) >> 1;
    z1h = rev64(z1h) >> 1;
    z2h = rev64(z2h) >> 1;

    let v0 = z0;
    let mut v1 = z0h ^ z2;
    let mut v2 = z1 ^ z2h;
    let mut v3 = z1h;

    v2 ^= v0 ^ (v0 >> 1) ^ (v0 >> 2) ^ (v0 >> 7);
    v1 ^= (v0 << 63) ^ (v0 << 62) ^ (v0 << 57);
    v3 ^= v1 ^ (v1 >> 1) ^ (v1 >> 2) ^ (v1 >> 7);
    v2 ^= (v1 << 63) ^ (v1 << 62) ^ (v1 << 57);

    v2 as u128 | (v3 as u128) << 64
}

/// Multiplication in GF(2)[X], truncated to the low 64-bits, with “holes”
/// (sequences of zeroes) to avoid carry spilling.
///
/// When carries do occur, they wind up in a "hole" and are subsequently masked
/// out of the result.
const fn bmul64(x: u64, y: u64) -> u64 {
    let x0 = x & 0x1111_1111_1111_1111;
    let x1 = x & 0x2222_2222_2222_2222;
    let x2 = x & 0x4444_4444_4444_4444;
    let x3 = x & 0x8888_8888_8888_8888;
    let y0 = y & 0x1111_1111_1111_1111;
    let y1 = y & 0x2222_2222_2222_2222;
    let y2 = y & 0x4444_4444_4444_4444;
    let y3 = y & 0x8888_8888_8888_8888;

    let mut z0 = (wmul(x0, y0)) ^ (wmul(x1, y3)) ^ (wmul(x2, y2)) ^ (wmul(x3, y1));
    let mut z1 = (wmul(x0, y1)) ^ (wmul(x1, y0)) ^ (wmul(x2, y3)) ^ (wmul(x3, y2));
    let mut z2 = (wmul(x0, y2)) ^ (wmul(x1, y1)) ^ (wmul(x2, y0)) ^ (wmul(x3, y3));
    let mut z3 = (wmul(x0, y3)) ^ (wmul(x1, y2)) ^ (wmul(x2, y1)) ^ (wmul(x3, y0));

    z0 &= 0x1111_1111_1111_1111;
    z1 &= 0x2222_2222_2222_2222;
    z2 &= 0x4444_4444_4444_4444;
    z3 &= 0x8888_8888_8888_8888;

    z0 | z1 | z2 | z3
}

/// Bit-reverse a `u64` in constant time
const fn rev64(mut x: u64) -> u64 {
    x = ((x & 0x5555_5555_5555_5555) << 1) | ((x >> 1) & 0x5555_5555_5555_5555);
    x = ((x & 0x3333_3333_3333_3333) << 2) | ((x >> 2) & 0x3333_3333_3333_3333);
    x = ((x & 0x0f0f_0f0f_0f0f_0f0f) << 4) | ((x >> 4) & 0x0f0f_0f0f_0f0f_0f0f);
    x = ((x & 0x00ff_00ff_00ff_00ff) << 8) | ((x >> 8) & 0x00ff_00ff_00ff_00ff);
    x = ((x & 0xffff_0000_ffff) << 16) | ((x >> 16) & 0xffff_0000_ffff);
    x.rotate_right(32)
}

/// Wrapping (modular) multiplication.
#[inline]
const fn wmul(a: u64, b: u64) -> u64 {
    a.wrapping_mul(b)
}

pub fn invert_or_zero(value: u128) -> u128 {
    // The algorithm is ported from https://github.com/reyzin/GF2t/blob/master/src/main/gf2t/GF2_128.java#L400
    // The only change is the way how x^(2^(2^k)) is calculated.
    // Computes self^{2^128-2}
    // self * self^(2^128 - 2) = self ^ (2^128-1) = 1 if self != 0

    // Contains self raised to the power whose binary representation is 2^k ones
    let mut self_pow_2_pow_k1s = value;

    // Square res to get its exponent to be 10 in binary
    let mut res = pow_2_2_n(self_pow_2_pow_k1s, 0);

    // Contains sel raised to the power whose binary representation is 2^k ones followed by 2^k zeros
    let mut selt_pow_2_pow_k1s_to_k0s = res;

    // Loop invariant
    // res contains z raised to the power whose binary representation is 2^{k+1}-1 ones followed by a single zero
    // self_pow_2_pow_k1s contains z raised to the power whose binary representation is 2^k ones
    // selt_pow_2_pow_k1s_to_k0s contains z raised to the power whose binary representation is 2^k ones followed by 2^k zeros
    for k in 1..7 {
        // Fill in the zeros in the exponent of selt_pow_2_pow_k1s_to_k0s with ones
        self_pow_2_pow_k1s = montgomery_multiply(self_pow_2_pow_k1s, selt_pow_2_pow_k1s_to_k0s);

        // selt_pow_2_pow_k1s_to_k0s = pow_2_2_n with 2^k zeros appended to the exponent
        selt_pow_2_pow_k1s_to_k0s = pow_2_2_n(self_pow_2_pow_k1s, k);

        // prepend 2^k ones to res
        res = montgomery_multiply(res, selt_pow_2_pow_k1s_to_k0s);
    }

    res
}

/// Calculates `value^(2^(2^n))`
fn pow_2_2_n(value: u128, n: usize) -> u128 {
    match n {
        // value^(2^(2^0)) = value
        0 => montgomery_multiply(value, value),
        1..=6 => {
            // Use the fact that for finite fields with characteristics 2
            // (x_0 + .. x_k)^(2^n) = x_0^(2^n) + ... + x_k^(2^n)
            // Split value into 4-bit nibbles and use precalculated values.
            let bases_form = montgomery_multiply(value, 1);
            (0..32)
                .map(|nibble_index| {
                    let nibble_value = (bases_form >> (nibble_index * 4)) & 0x0F;

                    POLYVAL_NIBBLE_POW_2_N_TABLE[n - 1][nibble_index][nibble_value as usize]
                })
                .fold(0, BitXor::bitxor)
        }
        _ => value,
    }
}

